description:
WCS Korea Season 2 Ro32 


GSL is a Starcraft tournament run by the south korean organisation GOM TV
The videos are HD Rip from the GOM TV VODs with english commentary.
The Starcraft league is split into two divisions Code S and Code A, where Code S are the 32 best Starcraft 2 players in the world.
